public class StrStr {
    public String strStr(String s, String p) {
        if(s == null || p == null)
            return null;

        if(p.equals(""))
            return s;

        int match = -1;

        for(int i = 0; i < s.length(); i ++) {
            int start = i;
            int j     = 0;
            if(s.length() - i > p.length())
                break;

            for(; j < p.length() && start < s.length(); j ++, start++) {
                char cs = s.charAt(start);
                char cp = p.charAt(j);
                if(cs != cp)
                    break;
            }
            if( j == p.length()) {
                match = i;
                break;
            }
        }

        if(match >= 0)
            return s.substring(match);

        return null;
    }

    public static void main(String args[]) {
        StrStr str = new StrStr();
        str.strStr("", "");
    }
}
